import ButtonLayout from './NextButtonLayout'

const layoutStyle = {
  textAlign:'center'
};

const Layout = props => (
  <div style={layoutStyle}>
    <p>This is formatted.</p>
    {props.children}
    <ButtonLayout />
  </div>
);

export default Layout;
